import React from "react";
import { List, ListItem, TextField, withStyles } from "@material-ui/core";
import SelectInput from "./Select/SelectInput";

import selectValues from "./selectValues";

const styles = theme => ({
  input: {
    margin: theme.spacing.unit
  },
  textField: {
    marginLeft: theme.spacing.unit,
    marginRight: theme.spacing.unit,
    width: 200
  }
});

export default withStyles(styles)(({ classes }) => {
  return (
    <List component="ul">
      <ListItem>
        <TextField className={classes.textField} label="Search by name" />
      </ListItem>
      <ListItem>
        <SelectInput values={selectValues.types} />
      </ListItem>
    </List>
  );
});
